 "Correct Location (y)": "Localizaci\u00f3n correcta (y)", 
 "<p>Enter the text for the cloze activity in to the cloze field \nby either pasting text from another source or by typing text directly into the \nfield.<\/p><p> To select words to hide, double click on the word to select it and \nclick on the Hide\/Show Word button below.<\/p><p>More than one possible answer can be defined enclosing them with pipes (|). I.e.: |dog|cat|bird|<\/p>": "<p>Escriba o texto no campo baleiro para a actividade de encher ocos\nben pegando o texto desde outra fonte ou escrib\u00edndoo directamente no \ncampo.<\/p><p> Para seleccionar as palabras que hai que ocultar, prema d\u00faas veces na palabra para seleccionala e \nprema o bot\u00f3n Ocultar\/Mostrar palabra de abaixo.<\/p><p>Para engadir outras posibilidades de resposta deben empregarse tubaxes (|). Por exemplo.: |can|gato|paxaro|<\/p>", 
