 "Checking this option, a \"Page X of Y.\" text will be added to every page of the exported content (except ePub's frontpage). This doesn't affect Single Page and Text File export files.": "Marcando esta opci\u00f3n, engadirase un texto \"P\u00e1xina X de Y.\" a cada p\u00e1xina do contido exportado (ag\u00e1s na portada dun ePub). Non afecta a ficheiros exportados como P\u00e1xina HTML \u00fanica nin como Ficheiros de texto plano.", 
