 "<p>DropDown exercises are texts or sentences where students must select the correct words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>Os exercicios nos que se utiliza a Actividade Despregable son textos ou oraci\u00f3ns onde o alumnado debe elixir as palabras correctas. Util\u00edzanse normalmente coas seguintes finalidades:<\/p><ol><li>Para verificar o co\u00f1ecemento dos conceptos clave dun curso (poder\u00eda ser un test de co\u00f1ecemento previo, un exercicio formativo ou unha proba sumativa).<\/li><li>Para verificar a comprensi\u00f3n lectora.<\/li><li>Para verificar os co\u00f1ecementos de vocabulario.<\/li><li>Para comprobar a competencia morfol\u00f3xica u gramatical. <\/li><\/ol>", 
