 "<p>The Wikipedia iDevice allows you to locate \nexisting content from within Wikipedia and download this content into your eXe \nresource. The Wikipedia Article iDevice takes a snapshot copy of the article \ncontent. Changes in Wikipedia will not automatically update individual snapshot \ncopies in eXe, a fresh copy of the article will need to be taken. Likewise, \nchanges made in eXe will not be updated in Wikipedia. <\/p> <p>Wikipedia content \nis covered by the GNU Free Documentation 1.2 License, and since 2009 additionally\nby the Creative Commons Attribution-ShareAlike 3.0 Unported License.<\/p>": "<p>O iDevice Wikipedia permite localizar contido existente na Wikipedia e descargar este contido no seu recurso eXe. O iDevice Artigo da Wikipedia realiza unha copia do contido. Os cambios posteriores na Wikipedia non se reflectir\u00e1n automaticamente na copia do artigo en eXe, polo que \u00e9 preciso actualizala cunha nova copia. As\u00ed mesmo, os cambios que se fagan en eXe non actualizar\u00e1n a Wikipedia. <\/p> <p>O contido da Wikipedia est\u00e1 protexido por unha licenza Creative Commons Atribuci\u00f3n Compartir Igual 4.0<\/p>", 
