 "Contains letter %1": "Cont\u00e9n as letras %1", 
 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Select words in the text thatare key to understanding the concepts. Thesewill probably be verbs, nouns, and key adverbs.Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dd><p>Write a text using the target vocabulary. This text should be coherent and cohesive, and be of an appropriate length. Highlight the target words in the text. Choose alternatives with one clear answer.<\/p>  <\/dd>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl>  <dt>Se o seu obxectivo \u00e9 avaliar a comprensi\u00f3n lectora dos conceptos clave dun curso ou a comprensi\u00f3n lectora<\/dt>  <dd>    <p> Escriba un resumo do concepto ou lectura suficientemente extenso para que a s\u00faa lonxitude sexa adecuada para avaliar o co\u00f1ecemento do obxectivo, pero suficientemente curto para non inducir fatiga. Probablemente algo menos dunha p\u00e1xina impresa sexa un tama\u00f1o adecuado, pero considere a posibilidade de utilizar un texto menor para o alumnado de menor idade ou para principiantes.    <\/p>    <p>Seleccione palabras do texto que sexan claves para a comprensi\u00f3n dos conceptos. Estas ser\u00e1n probablemente verbos, substantivos e adverbios clave. Elixa alternativas con unha resposta clara.    <\/p>  <\/dd>  <dt>Se o seu obxectivo \u00e9 avaliar o co\u00f1ecemento de vocabulario: <\/dt>  <dd><p>Escriba un texto utilizando como obxectivo o vocabulario. Este texto debe ser coherente e cohesionado, ademais de ter unha lonxitude adecuada. Resalte as palabras clave no texto. Escolla alternativas cunha resposta clara.<\/p>  <\/dd>  <dt> Se o seu obxectivo \u00e9 avaliar morfolox\u00eda ou gram\u00e1tica:  <\/dt>  <dd>  <p>Escriba un texto no que se utilicen esas formas. Este texto debe ser coherente e ter unha unidade, ademais de ter unha lonxitude adecuada. Recorde que o obxectivo non \u00e9 o vocabulario, e polo tanto o significado b\u00e1sico das ra\u00edces deben ser ben co\u00f1ecidos polo alumnado.  <\/p>Resalte as palabras clave no texto. Propo\u00f1a alternativas coa mesma ra\u00edz pero con diferentes afixos. \u00c9 unha boa idea pedir a un compa\u00f1eiro ou unha compa\u00f1eira docente que realice os exercicios os exercicios para asegurarse que non haxa sorpresas!  <\/p>  <\/dd><\/dl>", 
