 "prove": "comprobar", 
 "<p>If left unchecked a small number of spelling and capitalization errors will be accepted. If checked only an exact match in spelling and capitalization will be accepted.<\/p><p><strong>For example:<\/strong> If the correct answer is <code>Elephant<\/code> then both <code>elephant<\/code> and <code>Eliphant<\/code> will be judged <em>\"close enough\"<\/em> by the algorithm as it only has one letter wrong, even if \"Check Capitalization\" is on.<\/p><p>If capitalization checking is off in the above example, the lowercase <code>e<\/code> will not be considered a mistake and <code>eliphant<\/code> will also be accepted.<\/p><p>If both \"Strict Marking\" and \"Check Capitalization\" are set, the only correct answer is \"Elephant\". If only \"Strict Marking\" is checked and \"Check Capitalization\" is not, \"elephant\" will also be accepted.<\/p>": "<p>Se non se selecciona, aceptarase un pequeno n\u00famero de erros ortogr\u00e1ficos e de uso de mai\u00fasculas e min\u00fasculas. Se est\u00e1 marcado, non se aceptar\u00eda ning\u00fan erro ortogr\u00e1fico e de uso de mai\u00fasculas e min\u00fasculas.<\/p><p><strong>Por exemplo:<\/strong> Se a resposta correcta \u00e9 <code>Elefante<\/code> ent\u00f3n tanto <code>elefante<\/code> como <code>Elefantes<\/code> ser\u00e1n xulgados como <em>\"suficientemente correctos\"<\/em> polo algoritmo, xa que s\u00f3 ten unha letra errada, a\u00ednda que \"Comprobar mai\u00fasculas\/min\u00fasculas\" estea activada.<\/p><p>Se a verificaci\u00f3n das mai\u00fasculas est\u00e1 desactivada no exemplo anterior, a min\u00fascula <code>e<\/code> non se considerar\u00e1 como un erro e <code>elefante<\/code> tam\u00e9n ser\u00e1 aceptada.<\/p><p>Se tanto \"Marcaci\u00f3n estrita\" como \"Comprobar mai\u00fasculas\/min\u00fasculas\" est\u00e1n seleccionadas, a \u00fanica resposta correcta \u00e9 \"Elefante\".<\/p> Se s\u00f3 est\u00e1 seleccionada a \"Cualificaci\u00f3n estrita\" e \"Comprobar mai\u00fasculas\/min\u00fasculas\" non o est\u00e1, \"elefante\" ser\u00e1 ent\u00f3n aceptada. Se soamente marca \"Cualificaci\u00f3n estrita\" e non \"Comprobar mai\u00fasculas\/min\u00fasculas\", \"elefante\" tam\u00e9n ser\u00e1 aceptado.<\/p>", 
