 "eXeLearning, the EXtremely Easy to use eLearning authoring tool\n   Usage: %s [OPTION] [PACKAGE]\n  -V, --version    print version information and exit\n  -h, --help       display this help and exit\n  --standalone     Run totally from current directory\n  --portable       Run in portable mode\nSettings are read from exe.conf in $HOME\/.exe on Linux\/Unix\/Mac OS or\nin Documents and Settings\/<user name>\/Application Data\/exe on Windows XP or\nUsers\/<user name>\/AppData\/Roaming\/exe on Windows 7": "eXeLearning, a extremadamente doada de usar ferramenta de autor\u00eda\n   Uso: %s [OPCI\u00d3N] [PAQUETE]\n  -V, --version    informa da versi\u00f3n\n  -h, --help       amosa este texto de axuda\n  --standalone     Exec\u00fatase dende o cartafol actual de xeito independente\n  --portable       Exec\u00fatase de xeito portable\nA configuraci\u00f3n lese do ficheiro exe.conf presente en $HOME\/.exe en Linux\/Unix\/MacOS ou\nen Documents and Settings\/<user name>\/Application Data\/exe on Windows XP ou en\nUsuarios\/<user name>\/AppData\/Roaming\/exe on Windows 7\/8\/10", 
 "User data": "Datos da persoa usuaria", 
 "Subtitles": "Subt\u00edtulos", 
 "Although more often used in formal testing \nsituations MCQs can be used as a testing tool to stimulate thought and  \ndiscussion on topics students may feel a little reticent in responding to. \n\nWhen designing a MCQ test consider the following:\n<ul>\n<li> What learning outcomes are the questions testing<\/li>\n<li>    What intellectual skills are being tested<\/li>\n<li> What are the language skills of the audience<\/li>\n<li> Gender and cultural issues<\/li>\n<li> Avoid grammar language and question structures that might provide \n     clues<\/li>\n<\/ul>\n ": "A pesar de seren usados con maior frecuencia en situaci\u00f3ns formais de test, \nas Preguntas de Escolla \u00danica p\u00f3dense usar como unha ferramenta de test para estimular o pensamento e \na discusi\u00f3n sobre temas nos que o alumnado se poder\u00eda amosar un pouco reticente a responder. \n \n\nCando dese\u00f1e un test de Preguntas de selecci\u00f3n m\u00faltiple considere os seguintes aspectos:\n<ul>\n<li> Sobre que resultados da aprendizaxe est\u00e1n incidindo as preguntas?<\/li>\n<li> Que capacidades intelectuais se est\u00e1n a avaliar?<\/li>\n<li> Cales son as habilidades ling\u00fc\u00edsticas das persoas destinatarias?<\/li>\n<li> Cuesti\u00f3ns culturais e de x\u00e9nero<\/li>\n<li> Evite as estruturas sint\u00e1cticas e as estruturas de preguntas que poidan ofrecer \n     pistas<\/li>\n<\/ul>\n ", 
