 "<p>\nThe image with text iDevice can be used in a number of ways to support both\nthe emotional (affective) and learning task (cognitive) dimensions of eXe\ncontent. \n<\/p><p>\n<b>Integrating visuals with verbal summaries<\/b>\n<\/p><p>\nCognitive psychologists indicate that presenting learners with a\nrepresentative image and corresponding verbal summary (that is presented\nsimultaneously) can reduce cognitive load and enhance learning retention.\nThis iDevice can be used to present an image (photograph, diagram or\ngraphic) with a brief verbal summary covering the main points relating to\nthe image. For example, if you were teaching the functions of a four-stroke\ncombustion engine, you could have a visual for each of the four positions of\nthe piston with a brief textual summary of the key aspects of each visual.\n<\/p>": "<p>\nO iDevice Imaxe con texto pode utilizarse de diferentes xeitos para apoiar as d\u00faas dimensi\u00f3ns de contido en eXe: a emocional (afectiva) e a actividade de aprendizaxe (cognitiva). \n<\/p><p>\n<b>Integraci\u00f3n de elementos visuais con resumos verbais<\/b>\n<\/p><p>\nOs psic\u00f3logos indican que presentar ao alumnado unha imaxe representativa e un resumo verbal simultaneamente pode reducir a carga cognitiva e aumentar a retenci\u00f3n da aprendizaxe.\nEste iDevice pode utilizarse para presentar unha imaxe (foto, diagrama ou gr\u00e1fico) con un breve resumo verbal que cubra os puntos principais relativos \u00e1 imaxe. Por exemplo, se estivera explicando as funci\u00f3ns dun motor de combusti\u00f3n de catro tempos, poder\u00eda ter unha representaci\u00f3n visual de cada unha das posici\u00f3ns do pist\u00f3n cun breve resumo verbal dos aspectos clave de cada imaxe.\n<\/p>", 
 "Please don't forget to write the file size.": "Non esqueza escribir o tama\u00f1o do ficheiro.", 
 "Style updated correctly": "Estilo actualizado correctamente", 
 "Creative Commons Attribution Non-commercial No Derivatives License 2.5": "Licenza Creative Commons Atribuci\u00f3n Non-comercial Sen obra derivada 2.5", 
 "Provide a caption for the flash you \n                                  have just inserted.": "Proporcione un t\u00edtulo para o ficheiro flash \n                                  que v\u00e9n de inserir.", 
 "<p>Cloze exercises are texts or sentences where students must fill in missing words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>Os exercicios de encher ocos consisten en textos ou oraci\u00f3ns onde o alumnado debe completar as palabras que faltan. Util\u00edzanse normalmente coas seguintes finalidades:<\/p><ol><li>Para verificar o co\u00f1ecemento dos conceptos clave dun curso (poder\u00eda ser un test de preco\u00f1ecemento, un exercicio formativo ou unha proba sumativa).<\/li><li>Para verificar a comprensi\u00f3n lectora.<\/li><li>Para verificar os co\u00f1ecementos de vocabulario.<\/li><li>Para comprobar a competencia morfol\u00f3xica ou gramatical. <\/li><\/ol>", 
